('settings_', 'a:7:{s:7:\"general\";a:2:{s:10:\"brand_name\";s:23:\"bandagisterie Confortho\";s:4:\"logo\";s:30:\"01JF5PNYB8JK5RSNGCNJZTEDV9.png\";}s:3:\"seo\";a:2:{s:5:\"title\";s:37:\"Confortho (orthopédie-bandagisterie)\";s:11:\"description\";s:46:\"Fabricant de technologies médicales à Liège\";}s:12:\"Tel Chênée\";s:12:\"04 263 53 73\";s:7:\"Tel Aye\";s:12:\"084 43 37 40\";s:7:\"contact\";a:9:{s:5:\"email\";s:31:\"info@bandagisterie-confortho.be\";s:5:\"phone\";s:12:\"04 263 53 73\";s:8:\"address1\";a:3:{s:6:\"street\";s:18:\"Rue du Confluent 2\";s:6:\"number\";s:1:\"2\";s:11:\"postal_code\";s:6:\"Liège\";}s:11:\"google_map1\";s:41:\"https://maps.app.goo.gl/gga4sbeQxCev3p1P9\";s:8:\"address2\";a:3:{s:6:\"street\";s:16:\"Rue du Vivier 30\";s:6:\"number\";s:2:\"30\";s:11:\"postal_code\";s:17:\"Marche-en-Famenne\";}s:11:\"google_map2\";s:41:\"https://maps.app.goo.gl/i3PsLucN7TcG4nyw5\";s:8:\"facebook\";s:66:\"https://www.facebook.com/p/Confortho-100066653604311/?locale=fr_FR\";s:9:\"instagram\";s:60:\"https://www.instagram.com/confortho.orthopedie?utm_source=qr\";s:8:\"linkedin\";s:60:\"https://www.instagram.com/confortho.orthopedie?utm_source=qr\";}s:10:\"conditions\";a:2:{s:9:\"generales\";s:2243:\"<h2>Conditions générales d\'utilisation</h2><h3>1. Conditions d\'utilisation</h3><p>L\'ensemble de ce site relève de la législation belge et internationale sur le droit d\'auteur et la propriété intellectuelle. Tous les droits de reproduction sont réservés, y compris pour les documents téléchargeables et les représentations iconographiques et photographiques. Sauf mention contraire, le contenu de ce site est la propriété exclusive de <strong>Confortho</strong>. La reproduction de tout ou partie de ce site, sous quelque forme que ce soit, est strictement interdite sans autorisation préalable.</p><h3>2. Protection des données personnelles</h3><p>Conformément au Règlement Général sur la Protection des Données (RGPD) et à la loi belge sur la protection des données, vous disposez d\'un droit d\'accès, de rectification, de suppression et d\'opposition concernant les données personnelles qui vous concernent. Vous pouvez exercer ces droits en nous contactant via l\'adresse suivante : <a href=\"mailto:info@bandagisterie-confortho.be\">info@bandagisterie-confortho.be</a>.</p><h3>3. Réalisation</h3><p>Ce site web a été réalisé par la société : <strong>Confortho</strong> - Avenue des Entreprises, 4000 Liège, Belgique.</p><h3>4. Hébergement</h3><p>Ce site web est hébergé par : <strong>OVH</strong>, 2 rue Kellermann – BP 80157 – 59053 Roubaix Cedex 1, France. Vous pouvez les contacter directement via leur site officiel.</p><h3>5. Liens vers les sites de tierce-parties</h3><p>Ce site contient des liens vers des sites externes gérés par des tiers. L\'accès à ces sites se fait aux risques et périls de l\'utilisateur. <strong>Confortho</strong> ne saurait être tenu responsable du contenu, des dommages, erreurs ou omissions présents sur ces sites.</p><h3>6. Accès aux zones protégées par un mot de passe</h3><p>L\'accès aux zones sécurisées de ce site est strictement réservé aux personnes autorisées. Toute tentative d\'accès non autorisé pourra donner lieu à des poursuites judiciaires conformément à la législation en vigueur.</p><p>Pour toute question ou demande d\'information complémentaire, <a href=\"https://bandagisterie-confortho.be/contact\">contactez-nous</a>.</p><p><br></p>\";s:10:\"vie_privee\";s:3351:\"<h2>Politique de confidentialité</h2><h3>1. Préambule</h3><p>Cette politique de confidentialité s\'applique au site : <strong>Confortho</strong>. Elle a pour but d\'exposer aux utilisateurs :</p><ul><li>La manière dont sont collectées et traitées leurs données personnelles (nom, adresse, email, IP, etc.).</li><li>Les droits des utilisateurs concernant ces données.</li><li>Le responsable du traitement des données.</li><li>La politique du site en matière de cookies.</li></ul><h3>2. Principes de collecte et traitement des données</h3><p>Conformément au Règlement Général sur la Protection des Données (RGPD), la collecte et le traitement des données respectent les principes suivants :</p><ul><li><strong>Licéité, loyauté et transparence</strong> : Les données sont collectées avec le consentement de l\'utilisateur.</li><li><strong>Finalités limitées</strong> : Les données sont collectées pour des objectifs précis (contact, gestion des commandes).</li><li><strong>Minimisation</strong> : Seules les données nécessaires sont collectées.</li><li><strong>Durée limitée</strong> : Les données sont conservées pour une durée déterminée.</li><li><strong>Intégrité et confidentialité</strong> : Les données sont sécurisées.</li></ul><h3>3. Données collectées et finalités</h3><p>Les données collectées incluent :</p><ul><li>Coordonnées : Nom, prénom, email, téléphone.</li><li>Demande de contact, devis ou commande en ligne.</li></ul><p>Les finalités incluent :</p><ul><li>Gestion des relations commerciales.</li><li>Réponse aux demandes de contact.</li></ul><h3>4. Transmission des données à des tiers</h3><p>Les données peuvent être transmises uniquement aux tiers suivants :</p><ul><li>Organismes de paiement en ligne (sécurisation des transactions).</li><li>Partenaires comptables pour la gestion des commandes.</li></ul><h3>5. Responsable du traitement</h3><p>Le responsable du traitement est : <strong>Confortho</strong>.<br>Vous pouvez nous contacter à l\'adresse suivante : <a href=\"mailto:info@bandagisterie-confortho.be\">info@bandagisterie-confortho.be</a></p><h3>6. Droits de l\'utilisateur</h3><p>Conformément à la réglementation, vous avez les droits suivants :</p><ul><li>Droit d\'accès, de rectification et de suppression des données.</li><li>Droit à la portabilité des données.</li><li>Droit d\'opposition au traitement des données.</li></ul><p>Pour exercer ces droits, contactez-nous à l\'adresse mentionnée ci-dessus.</p><h3>7. Utilisation des cookies</h3><p>Le site utilise des cookies pour améliorer l\'expérience utilisateur. Vous pouvez accepter ou refuser les cookies via les paramètres de votre navigateur. Cookies utilisés :</p><ul><li>Cookies de session.</li><li>Cookies analytiques pour mesurer le trafic (Google Analytics).</li></ul><h3>8. Sécurité des données</h3><p>Nous mettons en place des mesures techniques pour assurer la sécurité de vos données (certificat SSL, protection des accès).</p><h3>9. Modification de la politique</h3><p>La présente politique peut être modifiée à tout moment pour rester conforme aux lois en vigueur. Date de dernière mise à jour : <strong>20/04/2024</strong>.</p><p>Pour toute question, veuillez nous contacter via notre <a href=\"https://bandagisterie-confortho.be/contact\">page de contact</a>.</p><p><br></p>\";}s:8:\"horaires\";a:7:{s:5:\"lundi\";s:27:\"09:30–13:00 14:00–17:30\";s:5:\"mardi\";s:27:\"09:30–13:00 14:00–17:30\";s:8:\"mercredi\";s:27:\"09:30–13:00 14:00–17:30\";s:5:\"jeudi\";s:27:\"09:30–13:00 14:00–17:30\";s:8:\"vendredi\";s:27:\"09:30–13:00 14:00–17:30\";s:6:\"samedi\";s:27:\"09:30–13:00 14:00–17:30\";s:8:\"dimanche\";s:6:\"Fermé\";}}', 2056357737);
