(17, 'Sandra van Doesburg - Schaddelee', 'sandraschaddelee@gmail.com', 'Aye', '0123', 'Bonjour monsieur, madame,\r\n\r\nJ\'ai récemment émigré des Pays-Bas vers la Belgique. Tout est nouveau pour moi, comment cela fonctionne. J\'ai besoin de nouvelles semelles. La mutualité (CM) m’a dit que j’avais besoin d’une ordonnance d’un orthopédiste ou spécialiste! Sinon, ce n\'est pas valable pour l\'assurance. Et donc uniquement par l\'intermédiaire d\'un bandagiste, ce n\'est pas valable!\r\n\r\nMes pieds sont un peu affaissés, c\'est comme ça que je suis né. Est-ce que cela passe par vous ainsi que par la note/prescription pour l\'assurance ou dois-je d\'abord aller ailleurs ?\r\n\r\nJ\'ai entendu parler de vous par une connaissance et elle m\'a également dit qu\'il y aurait une personne parlant Néerlandais lundi 31-3, est-ce correct? Un orthopédiste?\r\n\r\nCet e-mail a été traduit à l\'aide de Google Translate, il peut donc ne pas être entièrement exact.\r\n\r\nBien à vous,\r\n\r\nSandra van Doesburg - Schaddelee\r\n03-07-1988\r\n\r\n\r\n\r\n\r\n-----------\r\n\r\n\r\nC\'est ce que dit CM:\r\n\r\nOm vanuit de wettelijke ziekteverzekering een tussenkomst te kunnen ontvangen voor steunzolen aangekocht bij een bandagist of verstrekker (= orthotec) in België moet u telkens een doktersvoorschrift van een specialist bezorgen aan de bandagist. De volgende specialisten komen in aanmerking :\r\n       \r\n    heelkunde\r\n    orthopedische heelkunde\r\n    neurochirurgie\r\n    fysische geneeskunde en revalidatie\r\n    reumatologie\r\n    kindergeneeskunde of pediatrie\r\n    neurologie of\r\n    neuropsychiatrie\r\n\r\nU maakt zo snel mogelijk best een afspraak bij een specialist. Uw huisarts kan u altijd door verwijzen naar een specialist. \r\n\r\nMet vriendelijke groeten \r\n\r\nVeerle Driesen \r\n\r\n\r\n\r\n\r\nFocusconsulent CC Internationale Overeenkomsten\r\n\r\nTeam Lidmaatschap 1\r\n\r\n02 204 32 00', '2025-03-27 10:32:50', '2025-03-27 10:32:50'),
