(28, 'pauque', 'ssapl.social@provincedeliege.be', 'Concerne TAVIER Marie Christine', '042795045', 'Facture CH25-277\r\n\r\nMadame, Monsieur,\r\n\r\nLes retraites provinciaux peuvent nous solliciter en cas  de difficultés financières. C’est le cas de Madame TAVIER Marie Christine. \r\n\r\nA la demande je suppose du corps médical, un corset lui a été déposé sur son lit d’hôpital. Or, elle en avait un à domicile. \r\nJe m’interroge, le médecin le sait normalement . Elle a d’ailleurs obtenu un remboursement de la mutuelle \r\nDe plus, ce dernier lui aurait été déposé sur son lit et elle est rentrée chez elle avec son sac et le corset emballé. \r\nEst-ce nécessaire ? Elle a certainement signé un document de réception malgré son état sédaté .\r\n\r\nCe corset faisant un double emploi, ne pourriez-vous faire un geste en lui reprenant ? (toujours emballé). Le personnel ne doit il pas s’informer avant. C’est une recommandation et non une obligation ? Achat forcé ? \r\nC’est mettre madame dans des difficultés financières supplémentaires. \r\n\r\n\r\nDans l’attente de vous lire, je vous prie de croire, Madame, Monsieur, mes sentiments dévoués.', '2025-06-10 11:16:55', '2025-06-10 11:16:55'),
