(66, 'Fausto Hastings', 'fausto.hastings88@gmail.com', 'Reply for candidate profiles', '08149766227', 'Hello,\r\n\r\nTop founders are already hiring AI-native engineers and shipping 10× faster.\r\nEvery week you wait, competitors are pushing features, testing users, and taking market share.\r\n\r\nWe offer AI-powered devs (4–5 yrs exp) at $2,500/mo — they move like a whole team, not a single hire.\r\n\r\nDon\'t be the founder who loses because someone else moved faster.\r\nReply and I’ll send profiles immediately.\r\n\r\nWant to discuss your MVP? https://hello.al-burraq.com \r\n\r\nWarm Regards,\r\n— Fausto Hastings\r\nFausto@al-burraq.com\r\nAl-Burraq Technologies\r\n\r\n\r\nShould you wish to stop getting future emails from me, just fill the form at bit. ly/fillunsubform with your domain address (URL).\r\nVia Enrico Fermi 26, Kew Gardens, CA, USA, 91997', '2025-11-07 04:08:10', '2025-11-07 04:08:10'),
(67, 'Bonnie McEvilly', 'bonnie.mcevilly@msn.com', 'No actors — just results', '08621143055', 'Hey, Amir here from Letstok.\r\nI came across your store and noticed your product catalog — really great work.\r\nI’d love to offer you a way to instantly turn those product pages into video ads featuring real people.\r\nLetstok does it all automatically — just paste your product link and get a ready-to-post video.\r\nTry it free today and use SHOPIFY-10 for bonus tokens.\r\nhttps://www.letstok.com\r\n\r\n\r\nIf at any point you choose to opt-out of further communications from this campaign, simply fill the form at bit. ly/fillunsubform with your domain address (URL).\r\nSveltekrogen 39, Lackawanna, CA, USA, 92231', '2025-11-12 21:19:18', '2025-11-12 21:19:18'),
