INSERT INTO `products` (`id`, `product_category_id`, `picture`, `title`, `slug`, `description`, `mettre_en_avant`, `afficher`, `created_at`, `updated_at`) VALUES
(1, 1, '01JF53NKJQY2GHM7V0S4XQR8N9.jpg', 'Orthèse du genou', 'orthese-du-genou', '<p>L\'<strong>orthèse du genou</strong> est un dispositif essentiel pour <strong>stabiliser</strong>, <strong>soulager</strong> et <strong>protéger</strong> votre articulation dans les cas de blessures, douleurs chroniques ou post-opérations. Conçue pour offrir un maintien optimal, elle réduit les contraintes sur le genou tout en permettant une mobilité sécurisée. Idéale pour traiter des pathologies telles que l’arthrose, les entorses ou les lésions ligamentaires, cette orthèse allie <strong>confort</strong>, <strong>durabilité</strong> et <strong>ajustement parfait</strong> pour accompagner votre quotidien ou vos activités sportives.</p>', 1, 1, '2024-09-27 17:14:49', '2024-12-15 11:11:11'),
(2, 2, '01J8THE8X7T732AF8YH2RQDFCS.jpg', 'Semelles orthopédiques', 'semelles-orthopediques', '<h2>Qu’est-ce qu’une semelle orthopédique ?</h2><p>Spécialement conçues pour <strong>traiter des difformités du pied ou certaines pathologies</strong>, les <strong>semelles orthopédiques</strong> sont plus spécifiquement un <strong>appareillage amovible créé sur mesure</strong> que l’on <strong>place directement dans une chaussure</strong>. Leur but est de <strong>corriger ou de compenser la posture</strong> de la personne qui en porte, mais également de <strong>soulager quelconque douleur plantaire</strong> qui pourrait survenir.</p><p>Une <strong>différence</strong> notable existe entre une <strong>semelle de bandagiste et de podologue</strong>. En podologie, cette dernière est pensée pour le mouvement alors qu’un bandagiste se base sur le pied posé à l’arrêt.</p><h2>Quels sont les types de semelle orthopédique ?</h2><p>La <strong>semelle orthopédique</strong> ne se résume pas qu’à un seul modèle. Il en existe divers qui peuvent être différenciés selon leur utilité. On retrouve ainsi celles :</p><ul><li>De <strong>correction </strong>pour améliorer la structure du pied de l’enfant ;</li><li>De <strong>compensation </strong>en cas de différence de hauteur entre les membres et qui permet de soulager les inflammations du tendon ;</li><li>De <strong>soutien </strong>qui offre un appui souple et précis ;</li><li>De <strong>décharge</strong> ;</li><li>De <strong>stabilisation</strong> ;</li><li>De <strong>stimulation</strong> qui a pour but de corriger les troubles fonctionnels ;</li><li>Et de <strong>sport</strong>.</li></ul><p><br></p>', 0, 1, '2024-09-27 17:14:49', '2024-09-27 18:06:01'),
(3, 3, 'confortho2.jpg', 'Chaussures orthopédiques pour enfants', 'chaussures-orthopediques-pour-enfants', '<p>Chaussures conçues pour les enfants</p>', 0, 1, '2024-09-27 17:14:49', '2024-09-27 17:14:49');
INSERT INTO `product_categories` (`id`, `title`, `slug`, `picture`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Orthèses & bandages', 'ortheses-bandages', '01JF5PK1P4SSP4SHRXGYV1WD1A.jpg', '<p>Découvrez notre gamme d’<strong>orthèses et bandages</strong>, conçue pour apporter <strong>soutien</strong>, <strong>stabilité</strong> et <strong>soulagement</strong> aux articulations et aux muscles. Idéals pour traiter les blessures, réduire les douleurs ou prévenir les récidives, nos dispositifs sont adaptés à chaque besoin : genoux, chevilles, poignets, coudes ou dos. Fabriqués avec des matériaux de qualité, ils offrent un <strong>confort optimal</strong> tout en favorisant une <strong>récupération rapide et efficace</strong>.</p>', '2024-09-27 17:14:49', '2024-12-15 11:03:34'),
(2, 'Semelles', 'semelles', '01JF5X9AN0YXFEJHSE49PJZZWF.jpg', '<p>Les <strong>semelles orthopédiques</strong> sur mesure sont conçues pour corriger les troubles posturaux, soulager les douleurs et améliorer votre confort lors de la marche ou de la course. Adaptées à vos besoins spécifiques, elles offrent un soutien optimal à votre voûte plantaire et répartissent les pressions exercées sur vos pieds. Idéales pour traiter des pathologies comme le pied plat, la fasciite plantaire ou les douleurs lombaires, nos semelles allient <strong>précision</strong>, <strong>durabilité</strong> et <strong>efficacité</strong> pour un bien-être au quotidien.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:52'),
(3, 'semelles orthopédiques ', 'chaussures-orthopediques', '01JF5WSE67KRGQGKWMS1JWJK9Y.jpeg', '<p>Nos <strong>semelles orthopédiques</strong> allient confort et fonctionnalité pour répondre aux besoins spécifiques de vos pieds. Conçues pour soulager les douleurs, corriger les déformations et améliorer la posture, elles s’adaptent parfaitement à votre morphologie grâce à des matériaux de haute qualité et une conception sur mesure.&nbsp;</p><p>Chaque paire de semelles est fabriquée dans nos ateliers. Nous respectons toujours les demandes de votre médecins en adaptant au maximum le maintient et les corrections a vos habitudes et vos demandes</p><p><br></p>', '2024-09-27 17:14:49', '2025-09-28 06:45:21'),
(4, 'Orthèses d\'assise', 'ortheses-dassise', '01JF5PK1P4SSP4SHRXGYV1WD1A.jpg', '<p>Les <strong>orthèses d\'assise</strong> sont spécialement conçues pour améliorer le <strong>confort</strong>, la <strong>posture</strong> et le <strong>soutien</strong> des personnes en position assise prolongée. Idéales pour les utilisateurs de fauteuils roulants ou les personnes souffrant de troubles posturaux, elles permettent de prévenir les douleurs, les déformations et les escarres. Nos orthèses d\'assise sont fabriquées sur mesure pour répondre à vos besoins spécifiques, en alliant <strong>ergonomie</strong>, <strong>durabilité</strong> et <strong>facilité d’entretien</strong>.</p>', '2024-09-27 17:14:49', '2024-12-15 11:03:57'),
(5, 'Prothèses', 'protheses', '01JF5X4JJ9YE9KQ6GDF71KDNA1.jpg', '<p>Les <strong>prothèses</strong> représentent une solution essentielle pour restaurer la mobilité et améliorer la qualité de vie des personnes ayant subi une amputation. Conçues sur mesure, nos prothèses s’adaptent parfaitement à la morphologie et aux besoins de chaque patient. Grâce aux technologies modernes et aux matériaux avancés, elles offrent un <strong>confort optimal</strong>, une <strong>stabilité renforcée</strong> et une <strong>liberté de mouvement</strong> exceptionnelle. Notre objectif : vous accompagner dans votre réadaptation pour retrouver votre autonomie en toute sérénité.</p>', '2024-09-27 17:14:49', '2024-12-15 18:36:16'),
(6, 'Aides à la mobilité', 'aides-a-la-mobilite', '01K67RQVYBJWW85126NW33K564.png', '<p>Découvrez notre gamme complète d’<strong>aides à la mobilité</strong> conçues pour faciliter vos déplacements au quotidien.</p><p>&nbsp;Que ce soit pour une utilisation temporaire ou permanente, nous proposons des solutions adaptées à chaque besoin : cannes, déambulateurs, fauteuils roulants et scooters électriques.&nbsp;</p><p>Nos produits allient <strong>confort, sécurité et ergonomie</strong>, afin de vous offrir une autonomie optimale en toute circonstance</p>', '2024-09-27 17:14:49', '2025-09-28 06:58:56'),
(7, 'Vêtements de compression', 'vetements-de-compression', '01JF5X9ERGTH6SZXZP6ASYX7SQ.jpg', '<p>Les <strong>vêtements de compression</strong> sont conçus pour améliorer la circulation sanguine, réduire les douleurs et favoriser la récupération musculaire. Idéaux pour traiter des pathologies comme les varices, l’œdème ou les troubles veineux, ces vêtements apportent un soutien ciblé tout en offrant un confort optimal. Disponibles en différentes tailles et niveaux de compression, ils sont adaptés à un usage quotidien ou post-chirurgical. Nos vêtements allient <strong>efficacité thérapeutique</strong>, <strong>élégance</strong> et <strong>durabilité</strong> pour répondre à vos besoins spécifiques.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:56'),
(8, 'Prothèses mammaires', 'protheses-mammaires', '01JF5X4PGK4M5GKNYMGM69P1FW.webp', '<p>Les <strong>prothèses mammaires</strong> sont conçues pour offrir une solution naturelle et confortable aux femmes ayant subi une mastectomie ou une chirurgie mammaire. Fabriquées avec des matériaux doux et légers, elles s’adaptent parfaitement à la morphologie pour garantir une <strong>apparence naturelle</strong> et un <strong>bien-être au quotidien</strong>. Disponibles en plusieurs tailles et formes, nos prothèses mammaires sont pensées pour redonner <strong>confiance</strong> et <strong>équilibre</strong> tout en respectant les besoins spécifiques de chaque femme.</p>', '2024-09-27 17:14:49', '2024-12-15 18:36:20'),
(9, 'Pédiatrie', 'pediatrie', '01JF5X1Z0X5DXVFDP5156NE7RX.webp', '<p>La <strong>pédiatrie orthopédique</strong> se concentre sur les besoins spécifiques des enfants en pleine croissance. Nous proposons des solutions adaptées pour traiter et prévenir les troubles posturaux, les malformations congénitales et les blessures liées à l’activité. Orthèses, semelles sur mesure, dispositifs d’assistance… chaque produit est conçu pour offrir un <strong>soutien optimal</strong>, tout en respectant le confort et la mobilité des plus jeunes. Notre objectif : accompagner leur développement en toute sérénité.</p><p><br></p>', '2024-09-27 17:14:49', '2024-12-15 18:34:51'),
(11, 'Médecine du sport', 'medecine-du-sport', '01JF5PK1P4SSP4SHRXGYV1WD1A.jpg', '<p>La <strong>médecine du sport</strong> accompagne les sportifs de tous niveaux dans la <strong>prévention</strong>, le <strong>traitement</strong> et la <strong>rééducation</strong> des blessures liées à l’activité physique. Grâce à des solutions personnalisées, comme des orthèses spécifiques, des semelles orthopédiques et des programmes de rééducation adaptés, nous vous aidons à optimiser vos performances tout en préservant votre santé. Notre objectif : favoriser une <strong>récupération rapide</strong> et garantir une pratique sportive <strong>saine et durable</strong>.</p>', '2024-09-27 17:14:49', '2024-12-15 11:02:26'),
(12, 'Remplacement total des articulations', 'remplacement-total-des-articulations', '01JF5X7S0Q4FQYRB04N2A6RJSV.jpg', '<p>Le <strong>remplacement total des articulations</strong> est une solution chirurgicale majeure pour retrouver une mobilité optimale et soulager les douleurs chroniques causées par l’usure ou les blessures. Que ce soit pour une hanche, un genou ou une autre articulation, cette intervention permet de remplacer les surfaces endommagées par des prothèses modernes et durables. Accompagnée d’une <strong>rééducation adaptée</strong>, cette procédure offre une amélioration significative de la qualité de vie, en redonnant <strong>confort</strong>, <strong>stabilité</strong> et <strong>autonomie</strong> au patient.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:01'),
(13, 'Traumatologie', 'traumatologie', '01JF5X9BEMY759QS7N9QX1EED3.jpg', '<p>La <strong>traumatologie</strong> se concentre sur la prise en charge des blessures liées aux accidents ou aux chocs, qu’il s’agisse de fractures, entorses, luxations ou lésions musculaires. Nous proposons des solutions adaptées, telles que des orthèses, des bandages de soutien et des programmes de rééducation personnalisés, pour favoriser une <strong>récupération rapide</strong> et prévenir les complications. Avec une approche alliant expertise et technologies modernes, la traumatologie vise à restaurer votre <strong>mobilité</strong>, votre <strong>confort</strong> et votre <strong>autonomie</strong>.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:53'),
(14, 'Membre supérieur', 'membre-superieur', '01JF5WZDWZK3HVQNWPH1QPTTK9.jpg', '<p>Nos solutions pour le <strong>membre supérieur</strong> sont conçues pour accompagner le traitement des blessures, des pathologies et des postures liées aux bras, épaules, coudes et poignets. Nous proposons des orthèses, attelles et dispositifs de soutien adaptés pour <strong>immobiliser, stabiliser</strong> et <strong>soulager</strong> les douleurs tout en facilitant la récupération. Que ce soit pour une <strong>rééducation post-opératoire</strong> ou un traitement conservateur, nos produits allient <strong>confort</strong> et <strong>efficacité</strong> au quotidien.</p>', '2024-09-27 17:14:49', '2024-12-15 18:33:28'),
(17, 'Rééducation & Médecine Physique', 'reeducation-medecine-physique', '01JF5X7R6D76HCQJD85B0YKWJ5.jpg', '<p>La <strong>rééducation et médecine physique</strong> se consacrent à la restauration de vos capacités fonctionnelles après une blessure, une intervention chirurgicale ou une maladie chronique. Grâce à des programmes personnalisés, nous combinons exercices thérapeutiques, dispositifs adaptés et techniques modernes pour vous aider à retrouver mobilité, force et autonomie. Notre approche globale intègre des solutions telles que les <strong>orthèses</strong>, la <strong>physiothérapie</strong> et la <strong>gestion de la douleur</strong>, afin d\'améliorer votre qualité de vie au quotidien.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:00'),
(18, 'Podologie', 'podologie', '01JF5X2Z8KAP96DX5A5Q58S9P7.jpeg', '<p>La <strong>podologie</strong> se spécialise dans la santé et le bien-être des pieds, essentiels pour une posture et une mobilité optimales. Nous proposons des solutions personnalisées telles que des <strong>semelles orthopédiques sur mesure</strong>, des traitements pour les affections courantes (hallux valgus, fasciite plantaire) et des conseils pour prévenir les douleurs liées à la marche ou à l’activité physique. En prenant soin de vos pieds, la podologie contribue à améliorer votre <strong>équilibre</strong>, votre <strong>confort</strong> et votre <strong>qualité de vie</strong> au quotidien.</p>', '2024-09-27 17:14:49', '2024-12-15 18:35:24'),
(19, 'Rhumatologie', 'rhumatologie', '01JF5X7XV8CYXJBRA9PYCT02MR.jpg', '<p>La <strong>rhumatologie</strong> se concentre sur le diagnostic, le traitement et la gestion des maladies touchant les articulations, les muscles et les os, telles que l\'arthrite, l\'ostéoporose ou les rhumatismes inflammatoires. Nos solutions incluent des dispositifs de soutien, des thérapies adaptées et un accompagnement personnalisé pour réduire les douleurs, améliorer la mobilité et prévenir les complications. Grâce à une approche globale, la rhumatologie vise à améliorer votre <strong>bien-être quotidien</strong> et à préserver votre <strong>autonomie</strong>.</p>', '2024-09-27 17:14:49', '2024-12-15 18:38:06'),
(20, 'Éducation des patients', 'education-des-patients', '01JF5WW812VN0XTBW9E9KM271J.webp', '<p>L’<strong>éducation des patients</strong> joue un rôle essentiel dans la prise en charge des pathologies et la réussite des traitements. Grâce à des conseils personnalisés et des informations claires, nous aidons les patients à comprendre leur condition, à adopter les bons gestes et à utiliser efficacement leurs dispositifs orthopédiques. Notre objectif est de favoriser l’<strong>autonomie</strong>, la <strong>prévention</strong> des complications et une meilleure qualité de vie au quotidien.</p>', '2024-09-27 17:14:49', '2024-12-15 18:31:43');
INSERT INTO `pros` (`id`, `title`, `description`, `category`, `subtitle`, `file_1`, `file_2`, `external_link`, `image`, `created_at`, `updated_at`) VALUES
(1, '3M', '<p>Les <strong>bandages 3M</strong> offrent une solution de haute qualité pour le <strong>soutien</strong>, la <strong>compression</strong> et la <strong>protection</strong> des zones blessées ou fragilisées. Conçus avec des matériaux innovants, ils allient <strong>confort</strong>, <strong>durabilité</strong> et <strong>facilité d\'utilisation</strong>. Idéaux pour une utilisation quotidienne ou après une intervention, les bandages 3M s\'adaptent parfaitement aux besoins des patients, qu\'il s\'agisse de stabiliser une articulation, de favoriser la cicatrisation ou de prévenir les blessures. Leur adhérence optimale garantit un maintien sûr et efficace.</p>', 'Bandagisterie', 'Bandages 3M', '01JF5QHMB64AS8QTQ626C0TX7B.pdf', '01JF5QHMBB9D8XK40Y02P4KBC1.pdf', 'https://dupontbandagisterie.fr', '01JF5QJYMGHEW76VRC03Q7J125.jpg', '2024-09-27 17:14:49', '2024-12-15 16:59:16'),
(2, 'Hansaplast', '<p>Les produits <strong>Hansaplast</strong> sont conçus pour offrir un <strong>soutien optimal</strong>, une <strong>protection fiable</strong> et un <strong>confort supérieur</strong> en orthopédie et soins des blessures. Idéaux pour soulager les douleurs musculaires, stabiliser les articulations ou protéger les plaies, les bandages, pansements et solutions Hansaplast allient <strong>innovation</strong> et <strong>qualité médicale</strong>. Adaptés aux besoins du quotidien ou d’un usage spécifique, ils garantissent une <strong>récupération efficace</strong> tout en préservant votre mobilité.</p>', 'Orthopédie', 'Hansaplast', '01JF5QKN44BN1NP8AG613QMR06.pdf', '01JF5QKN49J5YCWF6NFT9R871F.pdf', 'https://lambertorthopedie.fr', '01JF5QKN4CVA2TSW13CRQC642M.jpg', '2024-09-27 17:14:49', '2024-12-15 16:59:39');
