(9, 'Accompagnement Complet', 'Un suivi personnalisé, de la prise de mesure à l\'utilisation quotidienne de vos attelles', '\n<svg  xmlns=\"http://www.w3.org/2000/svg\"  width=\"24\"  height=\"24\"  viewBox=\"0 0 24 24\"  fill=\"none\"  stroke=\"currentColor\"  stroke-width=\"2\"  stroke-linecap=\"round\"  stroke-linejoin=\"round\"  class=\"icon icon-tabler icons-tabler-outline icon-tabler-medical-cross\"><path stroke=\"none\" d=\"M0 0h24v24H0z\" fill=\"none\"/><path d=\"M13 3a1 1 0 0 1 1 1v4.535l3.928 -2.267a1 1 0 0 1 1.366 .366l1 1.732a1 1 0 0 1 -.366 1.366l-3.927 2.268l3.927 2.269a1 1 0 0 1 .366 1.366l-1 1.732a1 1 0 0 1 -1.366 .366l-3.928 -2.269v4.536a1 1 0 0 1 -1 1h-2a1 1 0 0 1 -1 -1v-4.536l-3.928 2.268a1 1 0 0 1 -1.366 -.366l-1 -1.732a1 1 0 0 1 .366 -1.366l3.927 -2.268l-3.927 -2.268a1 1 0 0 1 -.366 -1.366l1 -1.732a1 1 0 0 1 1.366 -.366l3.928 2.267v-4.535a1 1 0 0 1 1 -1h2z\" /></svg>', '2024-12-15 10:23:16', '2025-03-03 10:18:38'),
(10, 'Un service de qualité ', 'Deux établissements à votre disposition pour un service et des conseils personnalisés', '\n<svg  xmlns=\"http://www.w3.org/2000/svg\"  width=\"24\"  height=\"24\"  viewBox=\"0 0 24 24\"  fill=\"none\"  stroke=\"currentColor\"  stroke-width=\"2\"  stroke-linecap=\"round\"  stroke-linejoin=\"round\"  class=\"icon icon-tabler icons-tabler-outline icon-tabler-medical-cross\"><path stroke=\"none\" d=\"M0 0h24v24H0z\" fill=\"none\"/><path d=\"M13 3a1 1 0 0 1 1 1v4.535l3.928 -2.267a1 1 0 0 1 1.366 .366l1 1.732a1 1 0 0 1 -.366 1.366l-3.927 2.268l3.927 2.269a1 1 0 0 1 .366 1.366l-1 1.732a1 1 0 0 1 -1.366 .366l-3.928 -2.269v4.536a1 1 0 0 1 -1 1h-2a1 1 0 0 1 -1 -1v-4.536l-3.928 2.268a1 1 0 0 1 -1.366 -.366l-1 -1.732a1 1 0 0 1 .366 -1.366l3.927 -2.268l-3.927 -2.268a1 1 0 0 1 -.366 -1.366l1 -1.732a1 1 0 0 1 1.366 -.366l3.928 2.267v-4.535a1 1 0 0 1 1 -1h2z\" /></svg>', '2024-12-15 10:23:22', '2025-03-03 10:15:38');
INSERT INTO `section3` (`id`, `image`, `category`, `title`, `description`, `ul_li_list`, `ul_li_list_2`, `link`, `created_at`, `updated_at`) VALUES
(1, '01JF5Q1AC5A14SQGGX9KQEAHXH.jpg', 'Bandagisterie spécialisée', 'Votre spécialiste en bandagisterie à Marche-en-Famenne', 'Chez Confortho Marche-en-Famenne, nous mettons à votre disposition des solutions orthopédiques adaptées pour vous accompagner dans votre quotidien. Spécialisés dans la vente et l\'adaptation d\'équipements de bandagisterie, nous vous offrons un service personnalisé alliant expertise, confort et qualité.\n\n', '<ul><li>Large gamme d\'aides à la mobilité&nbsp;</li><li>&nbsp;Chaussures orthopédiques sur mesure&nbsp;</li><li>&nbsp;Bandages et orthèses pour le confort articulaire&nbsp;</li><li>&nbsp;Solutions pour le traitement des douleurs lombaires&nbsp;</li></ul><p><br></p>', '<ul><li>Accompagnement par des professionnels qualifiés</li><li>Équipements modernes et innovants</li><li>Produits adaptés aux besoins de chaque patient</li><li>Service proche de vous avec un suivi personnalisé</li></ul>', 'https://bandagisterie-confortho.be/a-propos', '2024-09-27 17:34:38', '2024-12-15 16:49:38');
