(20, 'conditions.generales', '\"<h2>Conditions g\\u00e9n\\u00e9rales d\'utilisation<\\/h2><h3>1. Conditions d\'utilisation<\\/h3><p>L\'ensemble de ce site rel\\u00e8ve de la l\\u00e9gislation belge et internationale sur le droit d\'auteur et la propri\\u00e9t\\u00e9 intellectuelle. Tous les droits de reproduction sont r\\u00e9serv\\u00e9s, y compris pour les documents t\\u00e9l\\u00e9chargeables et les repr\\u00e9sentations iconographiques et photographiques. Sauf mention contraire, le contenu de ce site est la propri\\u00e9t\\u00e9 exclusive de <strong>Confortho<\\/strong>. La reproduction de tout ou partie de ce site, sous quelque forme que ce soit, est strictement interdite sans autorisation pr\\u00e9alable.<\\/p><h3>2. Protection des donn\\u00e9es personnelles<\\/h3><p>Conform\\u00e9ment au R\\u00e8glement G\\u00e9n\\u00e9ral sur la Protection des Donn\\u00e9es (RGPD) et \\u00e0 la loi belge sur la protection des donn\\u00e9es, vous disposez d\'un droit d\'acc\\u00e8s, de rectification, de suppression et d\'opposition concernant les donn\\u00e9es personnelles qui vous concernent. Vous pouvez exercer ces droits en nous contactant via l\'adresse suivante : <a href=\\\"mailto:info@bandagisterie-confortho.be\\\">info@bandagisterie-confortho.be<\\/a>.<\\/p><h3>3. R\\u00e9alisation<\\/h3><p>Ce site web a \\u00e9t\\u00e9 r\\u00e9alis\\u00e9 par la soci\\u00e9t\\u00e9 : <strong>Confortho<\\/strong> - Avenue des Entreprises, 4000 Li\\u00e8ge, Belgique.<\\/p><h3>4. H\\u00e9bergement<\\/h3><p>Ce site web est h\\u00e9berg\\u00e9 par : <strong>OVH<\\/strong>, 2 rue Kellermann \\u2013 BP 80157 \\u2013 59053 Roubaix Cedex 1, France. Vous pouvez les contacter directement via leur site officiel.<\\/p><h3>5. Liens vers les sites de tierce-parties<\\/h3><p>Ce site contient des liens vers des sites externes g\\u00e9r\\u00e9s par des tiers. L\'acc\\u00e8s \\u00e0 ces sites se fait aux risques et p\\u00e9rils de l\'utilisateur. <strong>Confortho<\\/strong> ne saurait \\u00eatre tenu responsable du contenu, des dommages, erreurs ou omissions pr\\u00e9sents sur ces sites.<\\/p><h3>6. Acc\\u00e8s aux zones prot\\u00e9g\\u00e9es par un mot de passe<\\/h3><p>L\'acc\\u00e8s aux zones s\\u00e9curis\\u00e9es de ce site est strictement r\\u00e9serv\\u00e9 aux personnes autoris\\u00e9es. Toute tentative d\'acc\\u00e8s non autoris\\u00e9 pourra donner lieu \\u00e0 des poursuites judiciaires conform\\u00e9ment \\u00e0 la l\\u00e9gislation en vigueur.<\\/p><p>Pour toute question ou demande d\'information compl\\u00e9mentaire, <a href=\\\"https:\\/\\/bandagisterie-confortho.be\\/contact\\\">contactez-nous<\\/a>.<\\/p><p><br><\\/p>\"', '2024-12-15 11:37:03', '2024-12-15 18:27:27'),
(21, 'conditions.vie_privee', '\"<h2>Politique de confidentialit\\u00e9<\\/h2><h3>1. Pr\\u00e9ambule<\\/h3><p>Cette politique de confidentialit\\u00e9 s\'applique au site : <strong>Confortho<\\/strong>. Elle a pour but d\'exposer aux utilisateurs :<\\/p><ul><li>La mani\\u00e8re dont sont collect\\u00e9es et trait\\u00e9es leurs donn\\u00e9es personnelles (nom, adresse, email, IP, etc.).<\\/li><li>Les droits des utilisateurs concernant ces donn\\u00e9es.<\\/li><li>Le responsable du traitement des donn\\u00e9es.<\\/li><li>La politique du site en mati\\u00e8re de cookies.<\\/li><\\/ul><h3>2. Principes de collecte et traitement des donn\\u00e9es<\\/h3><p>Conform\\u00e9ment au R\\u00e8glement G\\u00e9n\\u00e9ral sur la Protection des Donn\\u00e9es (RGPD), la collecte et le traitement des donn\\u00e9es respectent les principes suivants :<\\/p><ul><li><strong>Lic\\u00e9it\\u00e9, loyaut\\u00e9 et transparence<\\/strong> : Les donn\\u00e9es sont collect\\u00e9es avec le consentement de l\'utilisateur.<\\/li><li><strong>Finalit\\u00e9s limit\\u00e9es<\\/strong> : Les donn\\u00e9es sont collect\\u00e9es pour des objectifs pr\\u00e9cis (contact, gestion des commandes).<\\/li><li><strong>Minimisation<\\/strong> : Seules les donn\\u00e9es n\\u00e9cessaires sont collect\\u00e9es.<\\/li><li><strong>Dur\\u00e9e limit\\u00e9e<\\/strong> : Les donn\\u00e9es sont conserv\\u00e9es pour une dur\\u00e9e d\\u00e9termin\\u00e9e.<\\/li><li><strong>Int\\u00e9grit\\u00e9 et confidentialit\\u00e9<\\/strong> : Les donn\\u00e9es sont s\\u00e9curis\\u00e9es.<\\/li><\\/ul><h3>3. Donn\\u00e9es collect\\u00e9es et finalit\\u00e9s<\\/h3><p>Les donn\\u00e9es collect\\u00e9es incluent :<\\/p><ul><li>Coordonn\\u00e9es : Nom, pr\\u00e9nom, email, t\\u00e9l\\u00e9phone.<\\/li><li>Demande de contact, devis ou commande en ligne.<\\/li><\\/ul><p>Les finalit\\u00e9s incluent :<\\/p><ul><li>Gestion des relations commerciales.<\\/li><li>R\\u00e9ponse aux demandes de contact.<\\/li><\\/ul><h3>4. Transmission des donn\\u00e9es \\u00e0 des tiers<\\/h3><p>Les donn\\u00e9es peuvent \\u00eatre transmises uniquement aux tiers suivants :<\\/p><ul><li>Organismes de paiement en ligne (s\\u00e9curisation des transactions).<\\/li><li>Partenaires comptables pour la gestion des commandes.<\\/li><\\/ul><h3>5. Responsable du traitement<\\/h3><p>Le responsable du traitement est : <strong>Confortho<\\/strong>.<br>Vous pouvez nous contacter \\u00e0 l\'adresse suivante : <a href=\\\"mailto:info@bandagisterie-confortho.be\\\">info@bandagisterie-confortho.be<\\/a><\\/p><h3>6. Droits de l\'utilisateur<\\/h3><p>Conform\\u00e9ment \\u00e0 la r\\u00e9glementation, vous avez les droits suivants :<\\/p><ul><li>Droit d\'acc\\u00e8s, de rectification et de suppression des donn\\u00e9es.<\\/li><li>Droit \\u00e0 la portabilit\\u00e9 des donn\\u00e9es.<\\/li><li>Droit d\'opposition au traitement des donn\\u00e9es.<\\/li><\\/ul><p>Pour exercer ces droits, contactez-nous \\u00e0 l\'adresse mentionn\\u00e9e ci-dessus.<\\/p><h3>7. Utilisation des cookies<\\/h3><p>Le site utilise des cookies pour am\\u00e9liorer l\'exp\\u00e9rience utilisateur. Vous pouvez accepter ou refuser les cookies via les param\\u00e8tres de votre navigateur. Cookies utilis\\u00e9s :<\\/p><ul><li>Cookies de session.<\\/li><li>Cookies analytiques pour mesurer le trafic (Google Analytics).<\\/li><\\/ul><h3>8. S\\u00e9curit\\u00e9 des donn\\u00e9es<\\/h3><p>Nous mettons en place des mesures techniques pour assurer la s\\u00e9curit\\u00e9 de vos donn\\u00e9es (certificat SSL, protection des acc\\u00e8s).<\\/p><h3>9. Modification de la politique<\\/h3><p>La pr\\u00e9sente politique peut \\u00eatre modifi\\u00e9e \\u00e0 tout moment pour rester conforme aux lois en vigueur. Date de derni\\u00e8re mise \\u00e0 jour : <strong>20\\/04\\/2024<\\/strong>.<\\/p><p>Pour toute question, veuillez nous contacter via notre <a href=\\\"https:\\/\\/bandagisterie-confortho.be\\/contact\\\">page de contact<\\/a>.<\\/p><p><br><\\/p>\"', '2024-12-15 11:37:03', '2024-12-15 18:27:27'),
